Функция РазобратьФИО(СтрокаФИО) Экспорт

    Результат = Новый Структура;
    Результат.Вставить("Фамилия", "");
    Результат.Вставить("Имя", "");
    Результат.Вставить("Отчество", "");
    Результат.Вставить("Инициалы", "");
    Результат.Вставить("ФИОКраткое", "");

    СтрокаОбработанная = СокрЛП(СтрокаФИО);

    Если ПустаяСтрока(СтрокаОбработанная) Тогда
        Возврат Результат;
    КонецЕсли;

    // Заменяем множественные пробелы на одинарные
    Пока СтрНайти(СтрокаОбработанная, "  ") > 0 Цикл
        СтрокаОбработанная = СтрЗаменить(СтрокаОбработанная, "  ", " ");
    КонецЦикла;

    ЧастиФИО = СтрРазделить(СтрокаОбработанная, " ", Ложь);
    КоличествоЧастей = ЧастиФИО.Количество();

    Если КоличествоЧастей >= 1 Тогда
        Результат.Фамилия = ЧастиФИО[0];
    КонецЕсли;

    Если КоличествоЧастей >= 2 Тогда
        Результат.Имя = ЧастиФИО[1];
    КонецЕсли;

    Если КоличествоЧастей >= 3 Тогда
        Результат.Отчество = ЧастиФИО[2];
    КонецЕсли;

    // Формируем инициалы
    Если Не ПустаяСтрока(Результат.Имя) Тогда
        ИнициалИмени = ВРег(Лев(Результат.Имя, 1)) + ".";

        Если Не ПустаяСтрока(Результат.Отчество) Тогда
            ИнициалОтчества = ВРег(Лев(Результат.Отчество, 1)) + ".";
            Результат.Инициалы = ИнициалИмени + ИнициалОтчества;
        Иначе
            Результат.Инициалы = ИнициалИмени;
        КонецЕсли;
    КонецЕсли;

    // Формируем краткое ФИО
    Если Не ПустаяСтрока(Результат.Фамилия) Тогда
        Если Не ПустаяСтрока(Результат.Инициалы) Тогда
            Результат.ФИОКраткое = Результат.Фамилия + " " + Результат.Инициалы;
        Иначе
            Результат.ФИОКраткое = Результат.Фамилия;
        КонецЕсли;
    КонецЕсли;

    Возврат Результат;

