Функция РазобратьФИО(ФИО) Экспорт
	ФИО = СокрЛП(ФИО);
	МассивСлов = Новый Массив;
	Для Каждого Слово Из СтрРазделить(ФИО, " ") Цикл
		Если СокрЛП(Слово) <> "" Тогда
			МассивСлов.Добавить(СокрЛП(Слово));
		КонецЕсли;
	КонецЦикла;

	Фамилия = "";
	Имя = "";
	Отчество = "";

	Если МассивСлов.Количество() > 0 Тогда
		Фамилия = МассивСлов[0];
	КонецЕсли;
	Если МассивСлов.Количество() > 1 Тогда
		Имя = МассивСлов[1];
	КонецЕсли;
	Если МассивСлов.Количество() > 2 Тогда
		Отчество = МассивСлов[2];
	КонецЕсли;

	Инициалы = "";
	Если Имя <> "" Тогда
		Инициалы = Лев(Имя, 1) + ".";
		Если Отчество <> "" Тогда
			Инициалы = Инициалы + Лев(Отчество, 1) + ".";
		КонецЕсли;
	КонецЕсли;

	ФИОКраткое = "";
	Если Фамилия <> "" Тогда
		ФИОКраткое = Фамилия;
		Если Инициалы <> "" Тогда
			ФИОКраткое = ФИОКраткое + " " + Инициалы;
		КонецЕсли;
	Иначе
		ФИОКраткое = Инициалы;
	КонецЕсли;

	Результат = Новый Структура;
	Результат.Вставить("Фамилия", Фамилия);
	Результат.Вставить("Имя", Имя);
	Результат.Вставить("Отчество", Отчество);
	Результат.Вставить("Инициалы", Инициалы);
	Результат.Вставить("ФИОКраткое", ФИОКраткое);

	Возврат Результат;
КонецФункции

